import { useState } from "react";

function MensagemBoasVindas({pessoas}){
    const [nome, setNome] = useState()

    return(
        <div>
        {pessoas.map((pessoa, index) => (
            
                setNome(pessoas.nome)
            
        ))}
            <h1>Seja bem vindo {nome}</h1> 
       </div>
    )
}


export default MensagemBoasVindas
